import Login from "./components/Login";
import Pic from "./components/pic";

function App() {
  return (
    <div className="flex flex-row-reverse ">
      <div className="bg-[#0f172a] h-screen overflow-hidden ">
        <img src="bios.png" alt="bios" style={{ height: 200 }}></img>
      </div>

      <Login />
    </div>
  );
}

export default App;
